import React, { Component } from 'react'
import NewsItem from './NewsItem'

export class News extends Component {
  render() {
    return (
      <div className='container my-3'>
            <h2>News Top HeadLines</h2>
            <div className='row'>
                <NewsItem title="News" description="Mydesc"/>
                <NewsItem title="News" description="Mydesc"/>
            </div>
                <NewsItem title="News" description="Mydesc"/>
                <NewsItem title="News" description="Mydesc"/>
      </div>
    )
  }
}

export default News
